import React, { useState } from 'react';

function Home() {
  return (
    <div className="contenedor">
          <nav>
            <Link to="/">Inicio</Link>
            <Link to="/clientes">Clientes</Link>
            <Link to="/peliculas">Peliculas</Link> 
            <Link to="/rentas">Rentas</Link> 
          </nav>
    </div>

  )
}

export default Home;
